const styles = theme => ({
    constainer: {
        // maxHeight: 450,
        minHeight: 50,
        // overflow: 'auto'
    },
    bullet: {
        position: 'relative',
        top: 3,
        fontSize: 16,
        left: 10,
        '&.green': {
            color: '#759B13'
        },
        '&.red': {
            color: '#d71b28'
        }
    }
});

export default styles;
